import boto3

def check_unencrypted_snapshots(region, snapshot_ids):
    # Create a boto3 client for EC2 service
    ec2_client = boto3.client('ec2', region_name=region)

    # Get all snapshots in the specified region
    # response = ec2_client.describe_snapshots(OwnerIds=['self'])
    response = ec2_client.describe_snapshots(SnapshotIds=snapshot_ids)


    # Check encryption status for each snapshot
    for snapshot in response['Snapshots']:
        snapshot_id = snapshot['SnapshotId']
        encryption_status = snapshot.get('Encrypted', False)
        
        if encryption_status:
            # print(f"Snapshot {snapshot_id} is encrypted.") 
            print(f"{snapshot_id}") 

